Продается игровая приставка Sony PlayStation 3 12G, в отличном состоянии ("как новая"), в коробке, полный комплект. Цена продажи 6500р. Официальная гарантия 6 месяцев./
Вариант с 5 играми в комплекте = 8500р;/
Вариант с 10 играми в комплекте = 10500р;

Продается игровая приставка Sony PlayStation 3 SuperSlim 500G, в хорошем состоянии. Цена продажи 8000р. Официальная гарантия 6 месяцев./
Вариант с 5 играми в комплекте = 10000р;/
Вариант с 10 играми в комплекте = 11500р;
